import './App.css';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faJetFighter} from "@fortawesome/free-solid-svg-icons"
function App() {
  return (
    <div>
      <div className="logo">
        <FontAwesomeIcon icon={faJetFighter} />
      </div>
    </div>
  );
}

export default App;
